import React from 'react';
import { useSelector } from 'react-redux';

export default function profiler() {

    const {users} = useSelector((state) => {
        return {
            users: state.Users
        }
    });
    console.log('--== Users ', users);

    return (
        <div>
            <div>I have been served from React Router</div>
        </div>
    )
}
